import React from 'react';
import './App.css';

export default class App extends React.Component {
  constructor(props){
    super(props);

    this.state = {
      selectedUser : "margaux",
      selectedPokemon : "Pikachu",
      city : "Paris"
    }
  }

   render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1> Notre super POKEDEX version OCRES </h1>        
        </header>
        <input
          type="text"
          name="Pokemon"
          // value={pokemone}
        />
      </div>
    );
   }
    
}
